    false,nt"url": null,nt"notes": "This annual narrative report for Kirwin
    NWR outlines Refuge accomplishments during the 1982 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses management planning. Refuge administration is
    outlined; information about personnel, manpower programs, funding, and safety is
    given. Habitat management is also covered; subjects include wetlands, forests, croplands,
    grasslands, haying, pest control, water rights, and wilderness areas. The wildlife
    section of the report discusses endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources, and
    marking and bird banding. The public uses of the Refuge described in this report
    include interpretive programs, hunting, wildlife observation, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about major maintenance, equipment replacement, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"license_title":
